// src/components/Skills.js
import React from 'react';
import {
  SiPython,
  SiPytorch,
  SiTensorflow,
  SiDocker,
  SiAmazonaws,
  SiGit,
  SiLinux,
  SiMysql,
  SiWeightsandbiases,
  SiNumpy,
  SiPandas,
  SiScikitlearn,
  SiOpencv
} from 'react-icons/si';
import { RiLinksFill } from 'react-icons/ri';
import { FaBrain } from 'react-icons/fa';

const skillCategories = [
  {
    title: 'Programming & Core ML',
    skills: [
      { name: 'Python', icon: <SiPython className="text-yellow-500" /> },
      { name: 'PyTorch', icon: <SiPytorch className="text-red-500" /> },
      { name: 'TensorFlow', icon: <SiTensorflow className="text-orange-500" /> },
      { name: 'NumPy', icon: <SiNumpy className="text-blue-500" /> },
      { name: 'Pandas', icon: <SiPandas className="text-indigo-500" /> },
      { name: 'scikit-learn', icon: <SiScikitlearn className="text-yellow-600" /> },
      { name: 'OpenCV', icon: <SiOpencv className="text-green-600" /> }
    ]
  },
  {
    title: 'LLM & NLP',
    skills: [
      { name: 'LangChain', icon: <RiLinksFill className="text-green-500" /> },
      { name: 'LangGraph', icon: <RiLinksFill className="text-blue-500" /> },
      { name: 'Knowledge Distillation', icon: <FaBrain className="text-purple-500" /> },
      { name: 'Pruning', icon: <FaBrain className="text-pink-500" /> },
      { name: 'Quantization', icon: <FaBrain className="text-orange-400" /> }
    ]
  },
  {
    title: 'MLOps & Deployment',
    skills: [
      { name: 'Docker', icon: <SiDocker className="text-blue-400" /> },
      { name: 'AWS', icon: <SiAmazonaws className="text-orange-400" /> },
      { name: 'ONNX', icon: <FaBrain className="text-teal-500" /> },
      { name: 'Weights & Biases', icon: <SiWeightsandbiases className="text-yellow-400" /> }
    ]
  },
  {
    title: 'Development Tools',
    skills: [
      { name: 'Git', icon: <SiGit className="text-red-500" /> },
      { name: 'Linux', icon: <SiLinux className="text-gray-700 dark:text-gray-300" /> },
      { name: 'SQL', icon: <SiMysql className="text-blue-600" /> }
    ]
  }
];

const Skills = ({ isVisible }) => {
  return (
    <section
      id="skills"
      className={`section-padding bg-white dark:bg-gray-900 transition-all duration-700 ${
        isVisible ? 'opacity-100 translate-y-0' : 'opacity-0 translate-y-10'
      }`}
    >
      <div className="container mx-auto px-4">
        <h2 className="section-title">Technical Skills</h2>
        <p className="text-center text-gray-600 dark:text-gray-300 mb-16 max-w-3xl mx-auto">
          Expertise in machine learning, LLMs, and scalable deployment tools
        </p>

        <div className="grid grid-cols-1 md:grid-cols-2 gap-12">
          {skillCategories.map((category, index) => (
            <div key={index}>
              <h3 className="text-xl font-semibold mb-6 text-primary-600 dark:text-primary-400">
                {category.title}
              </h3>
              <div className="flex flex-wrap gap-4">
                {category.skills.map((skill, i) => (
                  <div
                    key={i}
                    className="px-4 py-3 bg-gray-50 dark:bg-gray-800 rounded-lg shadow hover:shadow-lg transition-all duration-300 flex items-center gap-3 text-gray-700 dark:text-gray-300"
                  >
                    <div className="text-2xl">{skill.icon}</div>
                    <span className="font-medium">{skill.name}</span>
                  </div>
                ))}
              </div>
            </div>
          ))}
        </div>
      </div>
    </section>
  );
};

export default Skills;
